description:
Picture This! (2008)  

Verenigde Staten
Komedie
92 minuten

geregisseerd door Stephen Herek
met Ashley Tisdale, Robbie Amell en Shenae Grimes

Mandy Gilbert is een verlegen buitenbeentje. Toch weet ze de aandacht te krijgen van Drew Patterson, de meest populaire jongen van de school. Hij vraagt haar mee uit naar het schoolbal en ze kan haar geluk niet op. Problemen ontstaan als Mandy&amp;#039;s overbeschermende vader haar geen toestemming geeft om met hem uit te gaan en Drew&amp;#039;s ex-vriendin weer in beeld komt.


